import React, { useEffect, useState } from 'react'
import './styles.css'

const Game = () => {

    const [number, setNumber] = useState(0)


    const generateNumber = () => {
        setNumber(Math.floor(Math.random() * 100))
    }



    useEffect(() => {
        generateNumber()
    }, [])

    return (
        <div className = 'game'>
            <div>
                <h1>{number}</h1>
            </div>
            <div>
                <button className = 'game_button'>{-(Math.floor(Math.random() * ((number/ Math.floor(Math.random() * number/2))) + 3)) }</button>
                <button className = 'game_button'>{-(Math.floor(Math.random() * 10))}</button>
                <button className = 'game_button'>{-1}</button>
            </div>

        </div>
    )
}

export default Game
